import beach from './beach';
import Tilt from 'react-tilt';

function Logo() {
  return (
    <div>
      <Tilt
        className="Tilt"
        options={{ max: 25 }}
        style={{ height: 250, width: 250 }}
      >
        <img src={beach}></img>
      </Tilt>
    </div>
  );
}

export default Logo;
